import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <label>Name</label>
        <input type="text" placeholder="Write your name here"/>
        <button>SEND</button>
        <h2>ENTRANDO EN LA APLICACION</h2>
      </div>
    );
  }
}

export default App;
